                        fontSize: '14px',
                      }}
                    >
                      {value.title}
                    </p>
                    <p
                      style={{
                        fontFamily: 'Lato',
                        fontWeight: '300',
                        fontSize: '14px',
                      }}
                    >
                      50ml
                    </p>
                    <p
                      style={{
                        fontFamily: 'Lato',
                        fontWeight: '300',
                        fontSize: '14px',
                      }}
                    >
                      $ 34
                    </p>
                    <div
                      style={{
                        width: '138px',
                        height: '42px',
                        display: 'flex',
                        alignItems: 'center',
                        justifyContent: 'space-between',
                        border: 'solid 1px black',
                        paddingLeft: '10px',
                        paddingRight: '10px',
                      }}
                    >
                      <span style={{ fontWeight: '700', fontSize: '14px' }}>
                        -
                      </span>
                      <span style={{ fontWeight: '700', fontSize: '14px' }}>
                        1
                      </span>
                      <span style={{ fontWeight: '700', fontSize: '14px' }}>
                        +
                      </span>
                    </div>
                  </div>
                  <div style={{ marginTop: '5px', marginLeft: '10px' }}>
                    {value.tick ? (
                      <img
                        style={{ width: '18px', height: '18px' }}
                        src="./image/modal/modaltick.png"
                        alt="modal tick"
                      />
                    ) : (
                      <div
                        style={{
                          width: '18px',
                          height: '18px',
                          border: 'solid 1px grey',
                        }}
                      ></div>
                    )}
                  </div>
                </div>
              );
            })}
          </div>
          <div
            style={{
              display: 'flex',
              flexDirection: 'column',
              padding: '21px 30px 50px 30px',
            }}
          >
            <p
              style={{
                fontWeight: '300',
                fontFamily: 'Lato',
                marginBottom: '0px',
              }}
            >
              Selected (3) items
            </p>
            <div style={{ marginTop: '30px' }}>
              <Button
                style={{
                  width: '100%',
                  backgroundColor: '#FF9592',
                  color: '#000',
                  size: 'large',
                  height: '50px',
                }}
              >
                Add selected items to shopping cart
              </Button>
            </div>
            <div style={{ marginTop: '10px' }}>
              <Button
                style={{
                  width: '100%',
                  backgroundColor: '#FF9592',
                  color: '#000',
                  size: 'large',
                  height: '50px',
                }}
              >
               Add all items to shopping cart
              </Button>
            </div>
            <div style={{ marginTop: '39px' }}>
              <div
                style={{
                  display: 'flex',
                  flexDirection: 'row',
                }}
              >
                <img
                  src="./image/modal/modal1.png"
                  style={{
                    width: '140px',
                    height: '170px',
                    marginRight: '30px',
                  }}
                  alt="product"
                />

                <div style={{ display: 'flex', flexDirection: 'column' }}>
                  <p
                    style={{
                      fontWeight: '700',
                      fontFamily: 'Lato',
                      fontSize: '14px',
                    }}
                  >
                    APHRO the pearly goddess foaming cleanser
                  </p>
                  <p
                    style={{
                      fontFamily: 'Lato',
                      fontWeight: '300',
                      fontSize: '14px',
                    }}
                  >
                    50ml
