                    style={{
                      fontFamily: 'Lato',
                      fontWeight: '300',
                      fontSize: '14px',
                    }}
                  >
                    $ 34
                  </p>
                  <div
                    style={{
                      width: '138px',
                      height: '42px',
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'space-between',
                      border: 'solid 1px black',
                      paddingLeft: '10px',
                      paddingRight: '10px',
                    }}
                  >
                    <span style={{ fontWeight: '700', fontSize: '14px' }}>
                      -
                    </span>
                    <span style={{ fontWeight: '700', fontSize: '14px' }}>
                      1
                    </span>
                    <span style={{ fontWeight: '700', fontSize: '14px' }}>
                      +
                    </span>
                  </div>
                </div>
                <div style={{ marginTop: '5px', marginLeft: '10px' }}>
                <div
                  style={{
                    width: '18px',
                    height: '18px',
                    border: 'solid 1px grey',
                  }}
                ></div>
              </div>
              </div>

            </div>
          </div>
        </div>
      </Modal>
    </div>
  );
};

export default Navbar;
